/**
 * Sends a figure to the back of the drawing.
 */
public synchronized void sendToBack(Figure figure) {
    if (fFigures.contains(figure)) {
        fFigures.removeElement(figure);
        fFigures.insertElementAt(figure, 0);
        figure.changed();
    }
}
